import React from 'react';

class App extends React.Component 
{
  constructor(props) {
    super(props);

    this.state = {
      header: "Header from state...",
      content: "Content from state...",
      footer: "Going on foot..."
    }
  }
  render() {
    return (
      <div>
        <h1>{this.state.header}</h1>
        <h2>{this.state.content}</h2>
        <h3>{this.state.footer}</h3>
      </div>
    )
  }
}
export default App;
